mapper.select:
select 

from GP_CLASS_KLINE_D
where CLASSIFY_CODE = #{classifyCode,jdbcType=VARCHAR}
  and PERIOD_CODE = #{periodCode,jdbcType=VARCHAR}

select 

from GP_CLASS_KLINE_D
where DELETED_FLAG='0' and CLASSIFY_CODE = #{classifyCode,jdbcType=VARCHAR} 
AND SEQUENCE_NO = (SELECT MAX(SEQUENCE_NO) 
                        FROM GP_CLASS_KLINE_D 
                        WHERE DELETED_FLAG='0' AND ORIGIN_CODE='H'
                        AND CLASSIFY_CODE = #{classifyCode,jdbcType=VARCHAR}
                   )

mapper.delete:
delete from GP_CLASS_KLINE_D
where CLASSIFY_CODE = #{classifyCode,jdbcType=VARCHAR}
  and PERIOD_CODE = #{periodCode,jdbcType=VARCHAR}
